import React from 'react'
import { Button } from '@mui/material'
import { Link } from "react-router-dom";

export default function ButtonBar({ text,link }) {
    return (
        <Link to={link}
            style={{
                textDecoration:"none"
            }}
        >
            <Button color="inherit"
                sx={{
                    textDecoration:"none"
                }}
            >
                {text}
            </Button>
        </Link>
    )
}
